var _hoisted_15 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div data-v-56ca33d3><div class=\"container m-auto px-6 pt-12 md:pt-28\" data-v-56ca33d3><div class=\"flex items-center content-center\" data-v-56ca33d3><i class=\"fa-brands fa-wpexplorer text-emerald-500 text-4xl mr-4\" data-v-56ca33d3></i><h2 class=\"text-4xl text-emerald-500\" data-v-56ca33d3>Explore SIP</h2></div><div class=\"flex flex-col lg:flex-row-reverse align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-sandwich-1.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The basis of the SIP panel technology is a sandwich panel. The panel consists of two OSB TOP4 boards and an insulating core made of expanded flame retardant polystyrene EPS, PIR (polyisocyanurate foam), graphite NEOPOR or Mineral wool. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>The production process results in a structural sandwich panel that is characterized by excellent thermal insulation properties, low bulk density and high structural rigidity.</p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>The production process results in a structural sandwich panel that is characterized by excellent thermal insulation properties, low bulk density and high structural rigidity.</p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>The panels are manufactured in several thicknesses and so their use covers a wide range of needs. They can be used as floors, perimeter walls, partitions, and roofs.</p></div></div><div class=\"flex flex-col lg:flex-row align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-3/5\" src=\"/images/sip-sandwich-2.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>The SIP panel building system is classified as a timber frame building system, but its physical and thermal insulation properties make it significantly superior to conventional timber frame buildings.</p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>In addition to the panels, the SIP building system also includes KVH and BSH certified structural lumber in strength class C24 or GL24h, glued laminated timber I-joists or CLT panels. Their quantity and size depend on the individual structural assessments of the buildings.</p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>Various fasteners, carpentry fittings, PUR foams, sealants and compression tapes are used to seal the joints between the panels. All materials are included in the individual delivery of the building system according to the submitted offers and no additional procurement is required.</p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3>Higher levels of energy efficiency, prevention of thermal bridges, airtightness of the building shell, and environmental aspects favourably distinguish the SIP building system from many traditional building systems.</p></div></div><div class=\"flex flex-col pt-12\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3>THE PROPERTIES OF OSB BOARDS:</h3><ul class=\"ml-8 text-slate-700 text-xl list-disc mb-4\" data-v-56ca33d3><li data-v-56ca33d3>good thermal resistance (wood is a natural insulator)</li><li data-v-56ca33d3>large formats allow fewer joints and thus less acoustic and heat loss</li><li data-v-56ca33d3>good fire resistance depending on the type of OSB</li><li data-v-56ca33d3>resistance to shock and vibration</li><li data-v-56ca33d3>resistance to earthquakes and strong winds (proven in California, Florida and Japan)</li><li data-v-56ca33d3>health safety</li><li data-v-56ca33d3>excellent workability</li></ul><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> Those OSB and plywood tiles no longer contain urea formaldehyde (UF), so they really aren&#39;t that toxic anymore, especially on the exterior of the house. </p></div><div class=\"flex flex-col pt-12\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3>POLYSTYROL (EPS)</h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> Polystyrene is commonly used in the construction industry. In its closed structure, polystyrene cells absorb almost no water. This occurs to some limited extent only in the pores between the interlocking foam particles. After drying, they return to their original form. In a short time, demand has led to the development of &#39;self-extinguishing polystyrene&#39;, which is better suited to the requirements for fire protection in buildings. From a fire protection point of view, the widespread use of EPS in sandwich constructions is suitable among non-combustible materials. Polystyrene insulations are now HBCD-free (hexabromocyclododecane). </p><h4 class=\"text-slate-700 text-xl mb-4 text-emerald-500\" data-v-56ca33d3>Polystyrene properties:</h4><ul class=\"ml-8 text-slate-700 text-xl list-disc mb-4\" data-v-56ca33d3><li data-v-56ca33d3>water resistance</li><li data-v-56ca33d3>excellent thermal insulation properties</li><li data-v-56ca33d3>fire safety</li><li data-v-56ca33d3>easy and safe handling</li></ul></div><div class=\"flex flex-col pt-12\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> ADVANTAGES OF THE SIP CONSTRUCTION SYSTEM </h3><div class=\"flex flex-col lg:flex-row align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-advantages-1.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP panel technology can solve a wide range of needs and its applications are almost unlimited. Its versatility can be used in the most demanding designs. It is therefore ideal for building atypical building structures, where it will also ensure the absence of thermal bridges. The SIP panel technology can be applied as a single building system to the entire building shell or combined with other building systems. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> With the SIP construction system, we can build the foundation of the building, external perimeter walls, interior partition walls, ceilings, flat and even sloping roofs. It can be used in the construction of houses, apartment buildings, administrative buildings, industrial buildings, schools and kindergartens, recreational facilities, cottages, and houseboats. The SIP construction system is an ideal solution for superstructures and extensions. </p></div></div><div class=\"flex flex-col lg:flex-row-reverse align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-advantages-2.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP panel is a lightweight building material (approx. 22 kg/m2) and there are several options for the foundation of the building. The most used method is a concrete slab foundation. It already saves on material as it will not need to carry as much load as heavy stonework or concrete buildings. For the customer, this therefore allows construction even in hard-to-reach places where construction machinery cannot reach. It is ideal for superstructure and extension projects where the original building would not be structurally able to cope with traditional construction systems such as masonry or concrete. The insulating core is strong and stable even after decades. It does not sag or become damp, which can be a common problem with conventional framed construction when poorly built. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP panel technology also allows the building foundations to be made from panels. An alternative and unique solution for construction is foundations on screw piles. The construction of the foundation plate on screw piles for a detached house takes from 2 to 3 days and results in no damage to the ground. A support structure of wooden or steel beams, on which SIP 210mm panels are placed, is fitted on drilled screw piles. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP panel technology has a unique application in construction is in the case of houseboats. Panels placed on the pontoon make for quick and efficient foundations of the building. </p></div></div></div></div></div>", 1);

