var _hoisted_18 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div data-v-56ca33d3><div class=\"container m-auto px-6 pt-12 md:pt-28\" data-v-56ca33d3><div class=\"flex items-center content-center\" data-v-56ca33d3><i class=\"fa-solid fa-person-digging text-emerald-500 text-4xl mr-4\" data-v-56ca33d3></i><h2 class=\"text-4xl text-emerald-500\" data-v-56ca33d3>Design and production process</h2></div><p class=\"mb-4 text-slate-700 text-xl pt-12\" data-v-56ca33d3> The SIP certified building system is manufactured in controlled and monitored factory conditions. The production process is carried out in several stages. The standard production process takes between two and four weeks. </p><div class=\"flex flex-col\" data-v-56ca33d3><div class=\"flex flex-col lg:flex-row align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-design.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> DESIGN </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The project takes about 2-3 weeks if the customer requests a bespoke project </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> During the design phase, technical, installation and production documentation is prepared. During the design phase, communication and approval of the design documentation takes place. Our professional team of engineers is available to provide advice regarding the design process, the finalising of designs, and the structural evaluation of buildings. </p></div></div><div class=\"flex flex-col lg:flex-row-reverse align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-production.png\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> PRODUCTION </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> This takes approximately 7 days </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The sandwich panel is created by adhesively glueing an insulating core between two 15mm thick OSB TOP 4 boards. The panel is then hardened and matured in a hydraulic press. After solidification, the panels are formatted and labelled. Once the job is complete, the panels and all other materials required for the construction are placed on lorries to be transported to the construction site. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP panel technology has a unique application in construction is in the case of houseboats. Panels placed on the pontoon make for quick and efficient foundations of the building. </p></div></div><div class=\"flex flex-col lg:flex-row align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-asembly.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> ASSEMBLY </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> Takes approximately 7 days </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> We provide our customers with full technical support. Our company offers a complete construction system, including all the necessary materials to complete the rough installation. We provide professional building management for the customer without unnecessary interruptions due to involvement of subcontractors. </p></div></div><div class=\"flex flex-col lg:flex-row-reverse align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-construction.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> CONSTRUCTION OF PERIMETER WALLS AND INTERIOR PARTITION WALLS </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> A layer of waterproofing is applied to the fabricated foundation plate. After its application, the foundation springs are anchored to the foundation plate and form the base for the construction system. An embedded KVH element is fitted on the foundation spring to install the panels. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> Construction of the perimeter walls begins from the corner of the building and continues around the perimeter. After their completion follows the installation of internal partition walls. Finally, wooden KVH elements are inserted in the mounting grooves from the top to support the panels with each other. The panels may contain a pre-prepared tunnel for wiring. All panels are marked and custom-made according to the project documentation, so the installation of the panels is very simple, fast, and precise. </p></div></div><div class=\"flex flex-col lg:flex-row align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-flor.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> FLOOR CONSTRUCTION </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> Between the perimeter walls and the interior partition walls, a ceiling structure for the construction of the floor is made. To create a ceiling structure, we have several solutions. The ceiling can consist of KVH, BSH ceiling elements, glued timber I-beams, SIP panels or CLT. The suitability of the materials used depends on the static assessment of the project architect and the requirements of customers. Folowing this, the construction perimeter walls and internal partition walls of the second floor begins. </p></div></div><div class=\"flex flex-col lg:flex-row-reverse align-center items-center pt-12\" data-v-56ca33d3><div class=\"w-full h-full lg:w-1/2 flex justify-center\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 w-full lg:w-4/5\" src=\"/images/sip-roof.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full lg:w-1/2\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> ROOF CONSTRUCTION </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> SIP panels are an effective solution for the construction of sloping roofs with a residential attic. The SIP construction system essentially creates both a structural and an insulating element of the roof. The attic is therefore directly insulated with SIP panels and no additional application of insulation materials is required. The joints are straight and precise, so the interior has a ready base for the installation of gypsum or fibrous gypsum plaster boards, which are applied directly to the panel. </p><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> SIP panel is also an ideal solution for flat roofs. As with both sloping and flat roofs, the panel is a structural as well as an insulating element of the roof. Its installation and application are very fast and saves a lot of additional work. From the inside, it is possible to install gypsum or fibrous gypsum boards directly to the panel. From the outside, EPS perimeter drains for water drainage and final waterproofing are applied. </p></div></div></div><div class=\"flex flex-col pt-12\" data-v-56ca33d3><h3 class=\"text-slate-700 text-2xl mb-4 text-emerald-500\" data-v-56ca33d3> WIDE VARIABILITY OF FINAL FINISHES </h3><p class=\"mb-4 text-slate-700 text-xl\" data-v-56ca33d3> The SIP construction system can be easily completed with a wide range of finishes from classic plaster to vented facades. </p><div class=\"w-full flex flex-wrap\" data-v-56ca33d3><div class=\"w-full md:w-1/2 pt-12\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 m-auto w-full lg:w-4/5\" src=\"/images/sip-1.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full md:w-1/2 pt-12\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 m-auto w-full lg:w-4/5\" src=\"/images/sip-2.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full md:w-1/2 pt-12\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 m-auto w-full lg:w-4/5\" src=\"/images/sip-3.jpg\" alt=\"\" data-v-56ca33d3></div><div class=\"w-full md:w-1/2 pt-12\" data-v-56ca33d3><img class=\"mb-4 lg:mb-0 m-auto w-full lg:w-4/5\" src=\"/images/sip-4.jpg\" alt=\"\" data-v-56ca33d3></div></div></div></div></div>", 1);

